import React from 'react'
import ReactDOM from 'react-dom'
import './react-video-category-card.css'

function VideoCategoryCard(props)
{
    return(
        <div className="video-category-card"
             onClick={() => props.handleAccordionClick()}>
            <h1 class="category-tag">{props.category}</h1>
            <iframe 
            width="560" 
            height="315" 
            src={props.url + "?rel=0&modestbranding=1&autohide=1&showinfo=0&controls=0"} 
            frameBorder="0" 
            allow="accelerometer; encrypted-media; gyroscope; picture-in-picture" 
            allowFullscreen>
            </iframe>
        </div>
    )
}

export {VideoCategoryCard}
